export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},zRwDZyzGsg:{data:{id:1285,attributes:{imdbId:"tt9032888",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzcxMDM0NWItMTVmYS00ODFkLWFlZTctYjZhMGM4ZTg3ODJiXkEyXkFqcGdeQXVyODIyOTEyMzY@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"}],item_lang:{data:{id:1948,attributes:{title:h,plot:"When intrepid New York City TV news reporter Kate Bradley (Tiya Sircar) is assigned a story about a mysterious good samaritan who keeps leaving $100,000 cash gifts on citizens' doorsteps around the city, she's sure there's a catch. Kate sets out to identify the anonymous Good Samaritan, aka \"Good Sam,\" and their true motives. As news of Good Sam sweeps across the country and the pressure mounts to uncover the truth, Kate's drawn down a surprising path that flips both her career and personal life upside down. As Kate unravels the surprising reasons behind the mysterious cash gifts, she opens her heart to a new love and the hope that selfless good is all around.",slug:"good-sam"}}},books:{data:[{id:7056,attributes:{title:h,description:"Ten seemingly random people in Los Angeles just found $100,000 sitting on their porches. No one knows where the money came from or why. When seasoned TV news reporter Kate Bradley starts asking questions, this feel-good story becomes a mystery. How far will Kate go to identify the generous soul known as “Good Sam,” who doesn’t seem to want to be found? With all the imposters, red herrings, and even an attraction to one of her “suspects,” Kate finds herself questioning everyone’s motives—those of strangers, her family, and even her own. The most dangerous thing Kate can do is lower her guard and let herself believe. But “Good Sam” has started something in the world: change. And Kate won’t just find the story of a lifetime, she might live it, too. Revised edition: This edition of Good Sam includes editorial revisions.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=U8lUMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2017-06-20",publisher:d,subtitle:b}},{id:7057,attributes:{title:"Perfectly Good Crime",description:"In this feel-good follow-up to the novel and Netflix film Good Sam, intrepid reporter Kate Bradley is back in a story that BuzzFeed calls \"mysterious, fascinating, and inspiring.\" When burglars target the palatial estates of American billionaires in a series of high-tech heists, Kate must venture inside the world of the superrich to investigate the biggest story of the year. But the answers don't come easy. The Los Angeles police detective who's helping Kate with the case has mysteriously disappeared, Kate's senator father demands she stop investigating, and the billionaire victims refuse to talk to the media. Still, Kate uncovers clues that prove the crimes are anything but ordinary: those behind the robberies have shocking--but uplifting--motives that just may bring about powerful change. As the heists escalate, Kate faces a momentous decision that could jeopardize her deepening relationship with fire captain Eric Hayes. Saddled with obligations to the public, her career, and her own heart, Kate must trust her instincts in a high-stakes search that will test everything she believes and force her to decide where she belongs. Revised edition: This edition of Perfectly Good Crime includes editorial revisions.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ix57vQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2019-04-01",publisher:d,subtitle:b}},{id:7058,attributes:{title:"The Good Stranger",description:"From the bestselling author of Good Sam--now a Netflix feature film--comes another Kate Bradley story about the nature of generosity and finding unexpected connections with strangers. TV reporter Kate Bradley arrives in Manhattan ready to take on a challenging new position as a national news correspondent. When a massive power outage plunges New York City into darkness, the disaster she expected to cover takes an unexpected turn. Someone is leaving thousands of mysterious gifts throughout the city, and the only clue to the giver's identity is the occasional note from \"A Stranger.\" Together with handsome TV series host Scott Jameson, Kate must make sense of these random generous acts, which quickly escalate in scale and capture the attention of viewers across the country. In early-morning stakeouts and late-night surveillance, they crisscross the city hunting down leads, but the elusive Stranger is always one step ahead. Menacing letters and videos addressed to Kate threaten to derail the investigation, but she's determined to uncover the identity of the benefactor. The closer Kate gets to the truth, the more clearly she sees that even the smallest act of generosity can bring about powerful change. And it just may take her own selfless act of kindness to solve the feel-good mystery of the year.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sYJBygEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2020-05-19",publisher:d,subtitle:b}},{id:7059,attributes:{title:"Random Acts of Kindness",description:"The true, inspiring tales in Random Acts of Kindness spotlight ordinary people who have found unique ways to show compassion and make a difference. Some of these stories will warm your heart and make you laugh; others will make you smile; and a few might make you cry-in a good way-with the joy of knowing there is so much goodness in the world.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w1utvwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Rachel Greco"],firstBook:e,published:"2019-03-19",publisher:"Melrose Hill Entertainment, Incorporated",subtitle:b}},{id:7060,attributes:{title:"The Space Between",description:"The truth isn't what it seems in this stirring novel of suspense. After presenting a major scientific breakthrough to a rapt audience across the country, renowned astronomer Sarah Mayfield returns home to a disturbing discovery. Her husband, Ben, a Los Angeles restaurateur, has disappeared, leaving behind an unexplained bank deposit of a million dollars, a loaded Glock in the nightstand, and a video security system that's been wiped clean. The only answers their son, Zack, can offer are the last words his father said to him: keep the doors locked and set the alarm. Sarah's marriage was more troubled than anyone suspected, but now she is afraid that her husband's recent past could be darker than she dares to admit. Suspecting that nothing about Ben's vanishing is what it seems, Sarah must delve into the space between old memories, newfound fears, and misleading clues to piece together the mystery of her husband's disappearance--and find what she hopes in her heart is the truth.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Yx-JtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2018-07-24",publisher:d,subtitle:b}}]}}},meta:{}}},prerenderedAt:1682568490966}}("Dete Meserve","","movie","Lake Union Publishing",null,"series",1,"Good Sam"))